        }
    }

    function LoadDistrict(id) {
        $(DistrictId).html(null);
        if (district[id] == undefined) {
            var url = '/cart/district/' + id;
            $.get(url, function (a) {
                district[id] = a;
                ShowDistrict(a);
                LoadWard($(DistrictId).val());
            });
            console.log(""Chưa có."");
        } else {
            ShowDistrict(district[id]);
            console.log(""Có rồi."");
        }

